import './Users.css';
import PageTitle from "../../../../shared/PageTitle/PageTitle";
import ItemUser from "./ItemUser/ItemUser";
import {useDispatch, useSelector} from "react-redux";
import ShowMoreButton from "./ShowMoreButton/ShowMoreButton";
import {SetUsers} from "../../../../redux/ActionCreators";

const Users = () => {
	// let users = useSelector(state => state.usersPage.users)
	let dispatch = useDispatch()

	const setUsers = () => {
		dispatch(
			SetUsers([
				{   'id': '1',
					'name': 'Vlad',
					'description': 'I\'m looking a job right now.',
					'country': 'Ukraine',
					'city': 'Kiev'},

				{   'id': '2',
					'name': 'Valera',
					'description': 'I\'m so pretty.',
					'country': 'Belarus',
					'city': 'Minsk'},

				{   'id': '3',
					'name': 'Carl',
					'description': 'I found the job.',
					'country': 'France',
					'city': 'Paris'},

				{   'id': '4',
					'name': 'Smith',
					'description': 'I\'m free to help you.',
					'country': 'USA',
					'city':  'Los Angeles'},]
			)
		)
	}
	let { users } = useSelector(state => state.usersPage)
	console.log('usersPage', users)
	let user_items = users.map(
		user => <ItemUser key={ user.id }
						  id={ user.id }
						  name={ user.name }
						  description={ user.description }
						  country={ user.country }
						  city={ user.city }/>)
	return (
		<div className='users'>
			<PageTitle title='Users'/>
			<div className="users__body">{ user_items }</div>
			<ShowMoreButton setUsers={ setUsers }/>
		</div>
	)
}

export default Users;
